import React from 'react';

export const Navbar = () => {
	return (
		<nav className="nav justify-content-center  ">
			<a className="nav-link active" href="#" aria-current="page">
				Active link
			</a>
			<a className="nav-link" href="#">
				Link
			</a>
			<a className="nav-link disabled" href="#">
				Disabled link
			</a>
		</nav>
	);
};
